description:
&quot;Fears are rising&quot;

Jean de Segonzac, Jay Beattie, Dan Dworkin           January 30, 2006



The strands of the conspiracy begin to come together after Rich and Laura kidnap Lee. Miles returns home after the confrontation on the beach and gets into a fight. A distraught Laura goes to see her son and is apprehended by Lee and his goons while Richard is captured at an Iderdex lab in Wilmington. Lee releases Laura and fakes her death, saying that &quot;the cat's out of the bag&quot;
and thus it doesn't matter what she does anymore. In the aftermath of the fight, Miles and his family are confronted by the police and a throng of angry townspeople. But as the townspeople go after him, there is word of a tsunami on the way and everyone flees to get to safety.
